import React, { useState } from "react";
import "./Dashboard.css";
import CreateFolderModal from "./CreateFolderModal";
import CreateFormModal from "./CreateFormModal";
import DeleteFolderModal from "./DeleteFolderModal";
import DeleteFormModal from "./DeleteFormModal";

const Dashboard = () => {
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [modalType, setModalType] = useState(null);
  const [folders, setFolders] = useState([]);
  const [forms, setForms] = useState([]);
  const [deleteFolderIndex, setDeleteFolderIndex] = useState(null);
  const [deleteFormIndex, setDeleteFormIndex] = useState(null);

  const openModal = (type) => {
    setModalType(type);
    setIsModalOpen(true);
  };

  const closeModal = () => {
    setIsModalOpen(false);
    setModalType(null);
  };

  const handleCreateFolder = (folderName) => {
    if (folderName.trim()) {
      setFolders([...folders, { name: folderName, forms: [] }]);
    }
    closeModal();
  };

  const handleCreateForm = (formName, folderIndex = null) => {
    if (formName.trim()) {
      if (folderIndex !== null) {
        const updatedFolders = [...folders];
        updatedFolders[folderIndex].forms.push(formName);
        setFolders(updatedFolders);
      } else {
        setForms([...forms, formName]);
      }
    }
    closeModal();
  };

  const handleDeleteFolder = () => {
    setFolders(folders.filter((_, index) => index !== deleteFolderIndex));
    setDeleteFolderIndex(null);
  };

  const handleDeleteForm = () => {
    setForms(forms.filter((_, index) => index !== deleteFormIndex));
    setDeleteFormIndex(null);
  };

  return (
    <div className="dashboard-container">
      <nav className="navbar">
        <h1>Dashboard</h1>
        <button onClick={() => openModal("folder")}>Create Folder</button>
        <button onClick={() => openModal("form")}>Create Form</button>
      </nav>
      <div className="content">
        <div className="folders-section">
          <h2>Folders</h2>
          {folders.map((folder, index) => (
            <div key={index} className="folder">
              <h3>{folder.name}</h3>
              <button onClick={() => setDeleteFolderIndex(index)}>
                Delete Folder
              </button>
              <ul>
                {folder.forms.map((form, idx) => (
                  <li key={idx}>
                    {form}
                    <button onClick={() => setDeleteFormIndex(idx)}>
                      Delete Form
                    </button>
                  </li>
                ))}
              </ul>
            </div>
          ))}
        </div>
        <div className="forms-section">
          <h2>Global Forms</h2>
          <ul>
            {forms.map((form, index) => (
              <li key={index}>
                {form}
                <button onClick={() => setDeleteFormIndex(index)}>
                  Delete Form
                </button>
              </li>
            ))}
          </ul>
        </div>
      </div>

      {isModalOpen && modalType === "folder" && (
        <CreateFolderModal
          onClose={closeModal}
          onSubmit={handleCreateFolder}
        />
      )}
      {isModalOpen && modalType === "form" && (
        <CreateFormModal
          onClose={closeModal}
          onSubmit={handleCreateForm}
          folders={folders}
        />
      )}
      {deleteFolderIndex !== null && (
        <DeleteFolderModal
          onClose={() => setDeleteFolderIndex(null)}
          onConfirm={handleDeleteFolder}
        />
      )}
      {deleteFormIndex !== null && (
        <DeleteFormModal
          onClose={() => setDeleteFormIndex(null)}
          onConfirm={handleDeleteForm}
        />
      )}
    </div>
  );
};

export default Dashboard;
